const fs = require('fs');

const raw = ``;


function segmentString(input, delimiter) {
    // Split the string using the delimiter
    const segments = input.split(delimiter);

    // Check if the first segment is an empty string (happens if the input starts with the delimiter)
    let startIndex = 0;
    if (segments[0] === '') {
        startIndex = 1; // Skip the first empty segment
    }

    // Prepend the delimiter to each segment (except possibly the first)
    for (let i = startIndex; i < segments.length; i++) {
        segments[i] = delimiter + segments[i];
    }

    // If the first segment was empty, remove it from the result
    if (startIndex === 1) {
        segments.shift();
    }

    return segments;
}

const parts = segmentString(raw, '2afbe00d01001001');

console.log(parts.length);

for (let i = 0; i < parts.length; i += 1) {
    const b = Buffer.from(parts[i], 'hex');

    fs.writeFileSync(`./dan-data-${i}.bin`, b);
}
